import React from "react";

interface Props {
  start_x: any;
  start_y: string;
  end_x: string;
  end_y: string;
  hiearchy_number: number;
  subject: string;
}

const Arrow = ({
  start_x,
  end_x,
  start_y,
  end_y,
  hiearchy_number = 0,
  subject,
}: Props) => {
  const concentration_positions: any[] = [
    ["synthetic", ["19.09%", "64.72%"]],
    ["cell", ["38%", "64.72%"]],
    ["devices", ["69.09%", "64.72%"]],
    ["imaging", ["69.09%", "64.72%"]],
  ];
  let sideLine: string;
  let bottomLine: string;
  sideLine = (start_x / 1 + 5).toString().concat("%");
  bottomLine = (63 - hiearchy_number).toString().concat("%");
  start_x = start_x.concat("%");
  let concentration_x: string = "0";
  let concentration_y: string = "0";
  for (var i = 0; i < concentration_positions.length; i++) {
    if (concentration_positions[i][0] == subject) {
      concentration_x = concentration_positions[i][1][0];
      concentration_y = concentration_positions[i][1][1];
    }
  }
  return (
    <svg className="full">
      <line
        className="arrow"
        x1={start_x}
        y1={start_y}
        x2={sideLine}
        y2={start_y}
      />
      <line
        className="arrow"
        x1={sideLine}
        y1={start_y}
        x2={sideLine}
        y2={bottomLine}
      />
      <line
        className="arrow"
        x1={sideLine}
        y1={start_y}
        x2={sideLine}
        y2={bottomLine}
      />
      <line
        className="arrow"
        x1={sideLine}
        y1={bottomLine}
        x2={concentration_x}
        y2={bottomLine}
      />
      <line
        className="arrow"
        x1={concentration_x}
        y1={bottomLine}
        x2={concentration_x}
        y2={concentration_y}
      />
    </svg>
  );
};

export default Arrow;
